import React from 'react';
import { Text, View, ScrollView, TextInput, image } from 'react-native';
import { getPooledFromElement } from 'react-native/Libraries/Components/Touchable/BoundingDimensions';

const Arquivo = () => {

  return (
    <View>

      <div>
        <label className="form-label">File</label>
        <input type="file" accept="application/pdf" />
      </div>

    </View>
  );


}

const Cat = () => {
  return (
    <View>
      <Text>Hello, I am...</Text>
      <TextInput
        style={{
          height: 40,
          borderColor: 'gray',
          borderWidth: 1,
          margin: 49,
          textAlign: 'center',
          borderRadius: 8,
          borderColor: 'ff0000'
        }}
        defaultValue="Name me!"
      />


    </View>
  );
}



const MeuApp = () => {
  return (
    <ScrollView>
      <Cat />
      <Text>
        SOME TEXT
      </Text>
      <View>
        <Text>
          Some more text
        </Text>

      </View>

      <TextInput
        style={{
          height: 40,
          borderEndColor: 'gray',
          borderWidth: 1,
          margin: 49,
          textAlign: 'center',
          borderRadius: 8,
          borderColor: 'ff0000'
        }}

        defaultValue="you can type in me"
      />
    </ScrollView>

  );
}

export default MeuApp; Cat;
